import React from "react";
import Header from "./components/Header";
import Footer from "./components/Footer";
import HomePage from "./components/Home"; // ✅ Import HomePage

import Blog from "./components/Blog";

import Careers from "./components/Careers";
import AboutUs from "./components/AboutUs";
import FAQ from "./components/Faq";
import OrderStatus from "./components/OrderStatus";
import Payment from "./components/Payment";

import ShippingDelivery from "./components/ShippingDelivery";
import WhatnewAffiliates from "./components/WhatnewAffiliates";


import Returns from "./components/Returns";
import ContactUs from "./components/ContactUs";
 import BecomeSeller from "./components/BecomeSeller.jsx";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "./App.css";

function App() {
  return (

  <Router>
     <Header />
      <Routes>

        <Route path="/become-seller" element={<BecomeSeller />} />
      <Route path="/" element={<HomePage />} /> {/* ✅ Added Home route */}
        <Route path="/blog" element={<Blog />} />
        <Route path="/careers" element={<Careers />} />
        <Route path="/about" element={<AboutUs />} />
        <Route path="/faq" element={<FAQ />} />

        <Route path="/order-status" element={<OrderStatus />} />
        <Route path="/payment" element={<Payment />} />
      <Route path="/shippingdelivery" element={<ShippingDelivery />} />
  <Route path="/WhatNewAffiliates" element={<WhatnewAffiliates />} />
        <Route path="/returns" element={<Returns />} />
        <Route path="/contact" element={<ContactUs />} />
      </Routes>

      <Footer />
    </Router>


  );
}

export default App;
